/*Table structure for table `retweet` */

DROP TABLE IF EXISTS `retweet`;

CREATE TABLE `retweet` (
  `uname` varchar(1000) default NULL,
  `tweetid` varchar(1000) default NULL,
  `tweet` varchar(1000) default NULL,
  `word` varchar(1000) default NULL,
  `date` varchar(1000) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `retweet` */

/*Table structure for table `tweet` */

DROP TABLE IF EXISTS `tweet`;

CREATE TABLE `tweet` (
  `id` int(11) NOT NULL auto_increment,
  `user` varchar(1000) default NULL,
  `tweet` varchar(1000) default NULL,
  `image` longblob,
  `date` varchar(1000) default NULL,
  `count` varchar(1000) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

